To determine how many sheets of paper Miguel uses every month, we can break down the problem into smaller parts and solve it step by step.

1. **Determine the number of pads Miguel uses per week:**
   Miguel uses 2 pads of paper per week.

2. **Calculate the total number of sheets of paper used per week:**
   Each pad contains 30 sheets of paper. Therefore, the total number of sheets used per week is:
   \[
   2 \text{ pads/week} \times 30 \text{ sheets/pad} = 60 \text{ sheets/week}
   \]

3. **Find out how many weeks are in a month:**
   A month typically has about 4 weeks. For simplicity, we can assume 4 weeks per month.

4. **Calculate the total number of sheets of paper used per month:**
   Multiply the weekly usage by the number of weeks in a month:
   \[
   60 \text{ sheets/week} \times 4 \text{ weeks} = 240 \text{ sheets/month}
   \]

Therefore, Miguel uses 240 sheets of paper every month. The final answer is:
