Let's break down the problem step by step.

1. **Identify the number of apples Andrea has:**
   Andrea has 52 apples.

2. **Determine the number of apples Jamal has:**
   Andrea has 8 more apples than Jamal. Therefore, Jamal has:
   \[
   52 - 8 = 44 \text{ apples}
   \]

3. **Find out how many bananas Jamal has:**
   Jamal has 4 more bananas than apples. Since Jamal has 44 apples, the number of bananas he has is:
   \[
   44 + 4 = 48 \text{ bananas}
   \]

4. **Calculate the number of bananas Andrea has:**
   Andrea has half as many bananas as Jamal. Since Jamal has 48 bananas, Andrea has:
   \[
   \frac{48}{2} = 24 \text{ bananas}
   \]

5. **Sum up all the fruits:**
   - Andrea's apples: 52
   - Jamal's apples: 44
   - Jamal's bananas: 48
   - Andrea's bananas: 24

   Adding these together:
   \[
   52 + 44 + 48 + 24 = 168
   \]

Therefore, the total number of fruits is 168. The final answer is:
