To determine how many cents Grayson earns from recycling in a four-week month, we need to follow these steps:

1. Calculate the value of the aluminum cans she recycles in one week.
2. Calculate the value of the plastic bottles she recycles in one week.
3. Add the values from steps 1 and 2 to find the total earnings for one week.
4. Multiply the weekly earnings by 4 to find the total earnings for the four-week month.

Let's start with the aluminum cans. Each aluminum can is worth 2 cents, and she drinks 3 cans a week. So, the value of the aluminum cans in one week is:
\[ 3 \text{ cans} \times 2 \text{ cents per can} = 6 \text{ cents} \]

Next, we calculate the value of the plastic bottles. Each plastic bottle is worth 3 cents, and she drinks 5 bottles a week. So, the value of the plastic bottles in one week is:
\[ 5 \text{ bottles} \times 3 \text{ cents per bottle} = 15 \text{ cents} \]

Now, we add the values of the aluminum cans and plastic bottles to find the total earnings for one week:
\[ 6 \text{ cents} + 15 \text{ cents} = 21 \text{ cents} \]

Finally, we multiply the weekly earnings by 4 to find the total earnings for the four-week month:
\[ 21 \text{ cents/week} \times 4 \text{ weeks} = 84 \text{ cents} \]

Therefore, Grayson earns 84 cents from recycling in a four-week month. The final answer is:
